import { useState } from "react";
import { useHistory } from "react-router-dom";
import styles from "../home.module.css";

function App() {
  const history = useHistory();

  async function QueryAllProducts(event) {
    event.preventDefault();

    fetch(
      'http://localhost:4000/channels/mychannel/chaincodes/smartContract?args=["ITEM"]&peer=peer0.org1.example.com&fcn=queryAllProducts',
      {
        method: "GET",
        headers: {
          "Content-Type": "application/json",
          Authorization: "Bearer " + localStorage.getItem("token"),
        },
      }
    )
      .then(function (response) {
        return response.json();
      })
      .then(function (data) {
        alert("All Products query successful");
        console.log(data);

        let container = document.getElementById("container");

        let table = document.createElement("table");
        table.setAttribute("class", styles.styledtable);

        const titleAttributes = [
          "Item Number",
          "Brand",
          "Colour",
          "Product Id",
          "Product Name",
          "Manufacturer",
          "Price",
          "Seller Id",
          "Size"
        ];
        let tableHead = document.createElement("thead");
        let trTitle = document.createElement("tr");

        titleAttributes.forEach((titleCard) => {
          let th = document.createElement("th");
          th.innerText = titleCard;
          trTitle.appendChild(th);
        });
        tableHead.appendChild(trTitle);

        let tableBody = document.createElement("tbody");


        //let table = document.createElement("table");

        data.forEach((item) => {
          let tr = document.createElement("tr");

          let vals = Object.values(item);

          vals.forEach((elem) => {
            let td = document.createElement("td");
            if (typeof elem === "object") {
              let vals1 = Object.values(elem);
              vals1.forEach((child) => {
                let td1 = document.createElement("td");
                td1.innerText = child;
                tr.appendChild(td1);
              });
            } else {
              td.innerText = elem;
              tr.appendChild(td);
            }
          });
          tableBody.appendChild(tr);
        });
        table.appendChild(tableHead);
        table.appendChild(tableBody);
        container.appendChild(table);
      })
      .catch((error) => console.error("Error:", error));
  }

  return (
    <div>
      <div class={styles.topnav}>
        <a href="/">Home</a>
        <a href="register">Register</a>
        <a href="login">Login</a>
        <a href="addproduct">Add Product</a>
        <a href="addseller">Add Seller</a>
        <a href="changeowner">Change Owner</a>
        <a href="authenticate">Authenticate</a>
        <a class={styles.active} href="queryall">
          Query All Products
        </a>
        <a href="queryprod">Query Product</a>
        <a href="addconsumer">Add Consumer</a>
        <a href="queryownerprod">Query Product Owner</a>
        <a href="queryseller">Query Seller</a>
        <a href="queryconsumer">Query Consumer</a>
        <a href="querytransaction">Query Transaction</a>
        <a href="queryassethistory">Query Asset</a>
      </div>
      <h1>Query All Products</h1>
      <form onSubmit={QueryAllProducts}>

        <h4 id="prod"></h4>
        <input type="submit" value="Query All" />
        <thead>
          <th>Item</th>
          <th>Product Id</th>
          <th>Product Name</th>
          <th>Brand</th>
          <th>Color</th>
          <th>Price</th>
          <th>Size</th>
          <th>Manufacturer</th>
          <th>SellerId</th>
        </thead>
        <container id="container"></container>
      </form>
    </div>
  );
}

export default App;
